                          transform: "skew(170deg)",
                        }}
                      >
                        Order Reports
                      </h6>
                    </div>
                  </Link>

                  <Link
                    to={{ pathname: `/form/reports/${location.id}` }}
                    className="col-8 offset-2 col-md-3 offset-md-1 mt-3"
                    style={tabStyle}
                  >
                    <div>
                      <h6
                        style={{
                          textAlign: "center",
                          padding: "35px 0px 5px 0px",
                          transform: "skew(170deg)",
                        }}
                      >
                        Form Reports
                      </h6>
                    </div>
                  </Link>

                  <Link
                    to={{ pathname: `/contact/reports/${location.id}` }}
                    className="col-8 offset-2 col-md-3 offset-md-1 mt-3"
                    style={tabStyle}
